import React from "react";
import { useState, useEffect } from "react";
import "./App.css";

const App = (props) => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    await fetch("https://jsonplaceholder.typicode.com/posts")
      .then((res) => res.json())
      .then((data) => setUsers(data))
      .catch((err) => {
        console.log(err);
      });
  };

  console.log(users);
  return (
    <div className="form">
      <button> learn</button>
    </div>
  );
};

export default App;
